import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Navbar extends Component {
  render() {
    return (
      <nav>
        <ul>
          <li>
            <Link to="/">BookNotes</Link>
          </li>
          <li>
            <Link to="/"> Sign In</Link>
          </li>
        </ul>
      </nav>
    );
  }
}
